#define WriteFileContentsToFile(fileContentsSize, directory, fullFilePath, fileContents) \
	shadermod::ir::filehelpers::createDirectoryRelwrsively(directory.c_str()); \
	std::ofstream binaryFile; \
	binaryFile.open(fullFilePath, std::ios::out | std::ios::binary); \
	if (binaryFile.is_open()) \
	{ \
		binaryFile.write(fileContents, fileContentsSize); \
		binaryFile.close(); \
	} \
	else \
	{ \
		LOG_ERROR("Failed to open effect file for writing: \"%ls\"", fullFilePath); \
		return E_FAIL; \
	}

